import * as React from 'react';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Typography from '@mui/material/Typography';
import { CardActionArea } from '@mui/material';
import cardone from "../images/cardone.png";
import cardsecond from "../images/cardsecond.png"
import cardthird from "../images/cardthird.png"
import cardfourth from "../images/cardfourth.png"
import cardfifth from "../images/cardfifth.png"

const Cards = () => {
  // Array of objects containing data for each card
  const cardData = [
    {
      title: "Card 1",
      image: cardone,
      description: "Description for Card 1",
    },
    {
      title: "Card 2",
      image: cardsecond,
      description: "Description for Card 2",
    },
    {
      title: "Card 3",
      image: cardthird,
      description: "Description for Card 3",
    },
    {
      title: "Card 4",
      image: cardfourth,
      description: "Description for Card 4",
    },
    {
      title: "Card 5",
      image: cardfifth,
      description: "Description for Card 5",
    },
  ];

  return (
    <>
      {cardData.map((card, index) => (
        <Card key={index} sx={{ maxWidth: 345 }}>
          <CardActionArea>
            <CardMedia
              component="img"
              height="140"
              image={card.image}
              alt={card.title}
            />
            <CardContent>
              <Typography gutterBottom variant="h5" component="div">
                {card.title}
              </Typography>
              <Typography variant="body2" color="text.secondary">
                {card.description}
              </Typography>
            </CardContent>
          </CardActionArea>
        </Card>
      ))}
    </>
  );
};

export default Cards;
